import Link from 'next/link'
import Logo from '../components/Logo'

const Navbar = () => (
    <nav class="navbar navbar-light bg-light" style={{backgroundColor: "#2b2b2b"}}>
        <a class="navbar-brand" href="#">
            <Logo/>
        </a>
    </nav>
)

export default Navbar;
